/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<li tabindex="${ifDefined(context.tabIndex)}" class="${classMap(context.classes.main)}" dir="${ifDefined(context.effectiveDir)}" @focusin="${context._onfocusin}" @focusout="${context._onfocusout}" @keyup="${context._onkeyup}" @keydown="${context._onkeydown}" @mouseup="${context._onmouseup}" @mousedown="${context._onmousedown}" @touchstart="${context._ontouchstart}" @touchend="${context._ontouchend}" @click="${context._onclick}" aria-selected="${ifDefined(context.ariaSelected)}" role="${ifDefined(context._accInfo.role)}" aria-expanded="${ifDefined(context._accInfo.ariaExpanded)}" title="${ifDefined(context.title)}" aria-level="${ifDefined(context._accInfo.ariaLevel)}" aria-posinset="${ifDefined(context._accInfo.posinset)}" aria-setsize="${ifDefined(context._accInfo.setsize)}" aria-labelledby="${ifDefined(context._id)}-invisibleText ${ifDefined(context._id)}-content" aria-disabled="${ifDefined(context.ariaDisabled)}" style="list-style-type: none;">${ context.placeSelectionElementBefore ? block1(context) : undefined }<div id="${ifDefined(context._id)}-content" class="ui5-li-content"><slot></slot></div>${ context.typeDetail ? block5(context) : undefined }${ context.placeSelectionElementAfter ? block6(context) : undefined }<span id="${ifDefined(context._id)}-invisibleText" class="ui5-hidden-text">${ifDefined(context._accInfo.listItemAriaLabel)}${ifDefined(context.accessibleName)}</span></li> `; };
const block1 = (context) => { return html`${ context.modeSingleSelect ? block2(context) : undefined }${ context.modeMultiSelect ? block3(context) : undefined }${ context.renderDeleteButton ? block4(context) : undefined }`; };
const block2 = (context) => { return html`<${scopeTag("ui5-radio-button", tags, suffix)} ?disabled="${context.isInactive}" tabindex="-1" id="${ifDefined(context._id)}-singleSelectionElement" class="ui5-li-singlesel-radiobtn" ?checked="${context.selected}" @click="${context.onSingleSelectionComponentPress}"></${scopeTag("ui5-radio-button", tags, suffix)}>`; };
const block3 = (context) => { return html`<${scopeTag("ui5-checkbox", tags, suffix)} ?disabled="${context.isInactive}" tabindex="-1" id="${ifDefined(context._id)}-multiSelectionElement" class="ui5-li-multisel-cb" ?checked="${context.selected}" aria-label="${ifDefined(context._accInfo.ariaLabel)}" @click="${context.onMultiSelectionComponentPress}"></${scopeTag("ui5-checkbox", tags, suffix)}>`; };
const block4 = (context) => { return html`<div class="ui5-li-deletebtn"><${scopeTag("ui5-button", tags, suffix)} tabindex="-1" data-sap-no-tab-ref id="${ifDefined(context._id)}-deleteSelectionElement" design="Transparent" icon="decline" ?disabled="${context.disableDeleteButton}" @click="${context.onDelete}" title="${ifDefined(context.deleteText)}"></${scopeTag("ui5-button", tags, suffix)}></div>`; };
const block5 = (context) => { return html`<div class="ui5-li-detailbtn"><${scopeTag("ui5-button", tags, suffix)} design="Transparent" icon="edit" @click="${context.onDetailClick}"></${scopeTag("ui5-button", tags, suffix)}></div>`; };
const block6 = (context) => { return html`${ context.modeSingleSelect ? block7(context) : undefined }${ context.modeMultiSelect ? block8(context) : undefined }${ context.renderDeleteButton ? block9(context) : undefined }`; };
const block7 = (context) => { return html`<${scopeTag("ui5-radio-button", tags, suffix)} ?disabled="${context.isInactive}" tabindex="-1" id="${ifDefined(context._id)}-singleSelectionElement" class="ui5-li-singlesel-radiobtn" ?checked="${context.selected}" @click="${context.onSingleSelectionComponentPress}"></${scopeTag("ui5-radio-button", tags, suffix)}>`; };
const block8 = (context) => { return html`<${scopeTag("ui5-checkbox", tags, suffix)} ?disabled="${context.isInactive}" tabindex="-1" id="${ifDefined(context._id)}-multiSelectionElement" class="ui5-li-multisel-cb" ?checked="${context.selected}" aria-label="${ifDefined(context._accInfo.ariaLabel)}" @click="${context.onMultiSelectionComponentPress}"></${scopeTag("ui5-checkbox", tags, suffix)}>`; };
const block9 = (context) => { return html`<div class="ui5-li-deletebtn"><${scopeTag("ui5-button", tags, suffix)} tabindex="-1" data-sap-no-tab-ref id="${ifDefined(context._id)}-deleteSelectionElement" design="Transparent" icon="decline" ?disabled="${context.disableDeleteButton}" @click="${context.onDelete}" title="${ifDefined(context.deleteText)}"></${scopeTag("ui5-button", tags, suffix)}></div>`; };


	return block0(context);
};

export default main;
